import './Card.css'

const Card = () => {
    return (
        <div id="card">
            <div id="img"><img src="https://madewithreact.com/assets/img/react-material-bootstrap-dashboard-pro.jpg?v=1f2ec887e3" /></div>
            <h5 id="heading"></h5>
            <p id="content">loremfffffffffffffffffffffffffff</p>
            <button id="btn">Click Here</button>
        </div>
    );
}
export default Card;
